import raw from './assets/LifeSimulation01.xml';

class map
{

      constructor()
      {
            fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  this.lines =  text.split('\n');
                  this.map_width = parseInt(this.lines[3]);
                  this.map_height = parseInt(this.lines[6]);
            })
           
      }
      getstuff() {
            fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  this.lines =  text.split('\n');
                  this.map_width = parseInt(this.lines[3]);
                  this.map_height = parseInt(this.lines[6]);
            })
            
      }
      get width() {
            return this.map_width
      }

      get height() {
            return this.map_height
      }

     
}
 
export default map;
